# виводить розклад
def print_schedule(schedule):
    for day in schedule.keys():
        print(f"Day {int(day)+1}")
        for lesson in schedule[day].keys():
            print(f"Lesson {lesson+1}")
            for group in schedule[day][lesson].keys():
                if schedule[day][lesson][group] != []:
                    print(f"Group {group+1}: teacher: {schedule[day][lesson][group][0]}, subject: {schedule[day][lesson][group][1]}")
                else:
                    print(f"Group {group+1}: -")


# виводить залишковий план
def print_remainder_plan(remainder_plan):
    for group in remainder_plan.keys():
        print(groups[group][0])
        for subject in remainder_plan[group].keys():
            print(f"\t{remainder_plan[group][subject]} : {subjects[subject]}")


# виводить кількість предметів в залишковому плані
def number_of_subject_from_remainder_plan(remainder_plan):
    number = 0
    for group in remainder_plan.keys():
        for subject in remainder_plan[group].keys():
            if remainder_plan[group][subject] != 0:
                number += 1
    return number


# виводить кількість вікон
def how_many_windows(schedule):
    windows = 0
    for group in groups.keys():
        for day in range(DAYS):
            no_lesson = True
            for lesson in range(LESSONS-1, 0, -1):
                if(schedule[day][lesson][group] == [] and not no_lesson):
                    windows += 1
                elif (schedule[day][lesson][group] != []):
                    no_lesson = False
    return windows

# виводить ключ словника по значенню
def get_key(d, value):
    for k, v in d.items():
        if v == value:
            return k


def func_inner(day, lesson, group, subjects_arr, teachers_arr, remainder_plan,
               group_teacher, teachers_matrix, groups_matrix, subjects_matrix, schedule):
    if groups_matrix[group][day][lesson] == 0:  # урок вільна
        for subject in subjects_arr:  # subjects.keys():  # вибираємо предмет (0-15)
            if remainder_plan[group][subject] > 0:  # предмет ще потрібно викладати на цьому тижні
                if subject not in subjects_matrix[group][day].values():  # предмета немає в цей день
                    for teacher in teachers_arr:  # teachers.keys() # перевіряємо всіх викладачів (0-27)
                        if subject in teacher_group_subject[teachers[teacher][1]]:  # вчитель веде предмет
                            if group_teacher[group][subject] == -1 or group_teacher[group][subject] == teacher:  # за предметом немає вчителя, або це і є вчитель класу
                                if teachers_matrix[teacher][day][lesson] == 0:  # вчитель немає уроку
                                    if schedule[day][lesson][group] != []:
                                        print(f"ERROR d:{day} l:{lesson}, g:{group} : [{teacher},{subject}]")
                                        print(schedule[day][lesson][group], '\n\n\n\n\n')

                                    groups_matrix[group][day][lesson] = 1  # урок буде зайнятий для групи
                                    teachers_matrix[teacher][day][lesson] = 1  # урок буде зайнятий для вчителя
                                    subjects_matrix[group][day][lesson] = subject  # предмет буде зайнятий в цей день
                                    remainder_plan[group][subject] -= 1  # зменшуємо кількість непровединих уроків

                                    if group_teacher[group][subject] == -1:  # якщо вчитель не був закріплений до класу
                                        group_teacher[group][subject] = teacher  # закріплюємо його за класом


                                    schedule[day][lesson][group] = [teacher, subject]
                                    return


def func(subjects_arr, groups_arr, teachers_arr, remainder_plan, group_teacher,
         teachers_matrix, groups_matrix, subjects_matrix_, schedule):
    for lesson in range(LESSONS):  # для кожного уроку (0-6)
        for day in range(DAYS):   # для кожного дня (0-4)
            for group in groups_arr:  # groups.keys():   # перебираємо кожну групу (0-18)
                func_inner(day, lesson, group, subjects_arr, teachers_arr, remainder_plan, group_teacher, teachers_matrix, groups_matrix, subjects_matrix_, schedule)


